import React, { Component } from 'react';
import 'bulma/css/bulma.css';

class Nav extends Component {
    render() {
      return (
        <div>
              <ul id="nav">
                <li><a href="/">Home</a></li>
                <li><a href="/journal">About</a></li>
                <li><a href="#">FAQ</a></li>
                <li><a href="#">Contact</a></li>
              </ul>
            </div>
    );
    }
  }

  export default Nav;
